@kparlante for review?

Currently the policy links will open in the same window, the reason for this is because the target attribute has been deprecated so we cannot use this without failing validation unless we use a transitional doctype.

The alternative is to use javascript to open these in a new tab but, the fallback, if javascript is disabled, will still be to open in the same window. With that said, if javascript is turned of FHR will basically be useless so it is basically a decision that needs to be made. Are we ok with it opening in the same window or not.

